import { React, Component } from 'react';

import Item from './Item';

class List extends Component {
	constructor(props) {
		super(props);
	}
	state = {};
	render() {
		const { todos } = this.props;
		return (
			<>
				<ul>
					{todos.map((todo, key) => {
						return (
							<Item
								todo={todo}
								key={key}
								handlePrepareEdit={this.props.handlePrepareEdit}
								handleDelete={this.props.handleDelete}
							/>
						);
					})}
				</ul>
			</>
		);
	}
}

export default List;
